import React from 'react'

function Home() {
    return (
        <div className='kato' >
            <div class="card ">
                <img src="assets/bg.jpg" class="card-img" alt="..." />
                <div class="card-img-overlay">
                    <h1 class="card-title">Welcome to Kato Fruits Palace</h1>
                    <p class="card-text"></p>
                    <p class="card-text"><small>Last updated 3 mins ago</small></p>
                </div>
            </div>

        </div>
    );
};

export default Home
